import React from 'react';
import Introduction from './Introduction';

const App = () => {

  const name = "정건";
  const hobby = "독서";

  return (
    <div>
      <div>후롱트 첫 리엑트 세션</div>
      <br/>
      <Introduction> {name}는 {hobby}</Introduction>>

    </div>
  );
};

export default App;
